import { IntersectionType } from "@thi.ng/geom-api";
import { closestPointSegment } from "@thi.ng/geom-closest-point";
import { EPS, eqDelta } from "@thi.ng/math";
import { mixN2 } from "@thi.ng/vectors";
export const intersectLineLine = (a, b, c, d, eps = EPS) => {
    const bax = b[0] - a[0];
    const bay = b[1] - a[1];
    const dcx = d[0] - c[0];
    const dcy = d[1] - c[1];
    const acx = a[0] - c[0];
    const acy = a[1] - c[1];
    const det = dcy * bax - dcx * bay;
    let alpha = dcx * acy - dcy * acx;
    let beta = bax * acy - bay * acx;
